import React from 'react'
import {Col, Container, Row} from "react-bootstrap";

const BottomContent = () => {
    return (
        <Container fluid style={{height:"100%"}}>
        <Row>
            <Col lg={2}>1 of 1</Col>
            <Col lg={10}>1 of 1</Col>
        </Row>
    </Container>)
};

export default  BottomContent;
